import React from 'react';

const Article = () => {
    return (
        <article>
            <div className="card">
            <img src="../img/anh1.jpg" alt="News Image"/>
            
            <div className="card-content">
                <h2>Vi phạm nồng độ cồn, tài xế xe công nghệ bỏ luôn phương tiện.</h2>
            </div>
        </div>
        </article>
    );
}

export default Article;
